import React from 'react'
import './style/watch.css'



class Movielist extends React.Component {


    render() {
        let movieList = [];

        for (let i = 0; i <= 5; i++) {
            movieList.push(<div id="movie" key={i}></div>)
        }
        return(
            <div id="watch">
                {movieList}
            </div>
        )
    }
}

export default Movielist;
